    false,nt"url": null,nt"notes": "This proposal is to collect samples of
    each species of Ophraella leaf beetle encountered, not to exceed 50 specimens per
    species, for genetic analysis using DNA sequencing.  The research is directed at
    three questions: (1) How recently have these species spread into the region, and
    from where? (2) Are there genetic differences among populations of a species in
    various geographic areas? (3) Do species that feed on different plants hybridize
    with each other?",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
